import React, { useRef } from 'react';
import './App.css';
import ViewCard from './components/ViewCard';
import { Container } from '@mui/material';

function App() {
  const cards = [1, 2, 3, 4, 5]
  return (
    <Container sx={{ height: "100vh", width: "100vw", alignItems: "center", justifyContent: "center" }}>
      { cards.map((card: any) => <ViewCard />) }
    </Container>
  );
}

export default App;
